import React from "react";

function Comments(comments) {
  return (
    <div className="post__comments">
      {comments.map((comment) => (
        <p>
          <strong>{comment.username}</strong>
          {comment.text}
        </p>
      ))}
    </div>
  );
}

export default Comments;
